var tipuesearch = {"pages": [{'title': '協同產品設計實習', 'text': '倉儲地址: https://s40723224.github.io/cd2021/ \n 第一週至第四週組員: \n 范誠宇(40723224) \n 林昭權(40623144) \n 第一週至第四週作品STL檔: https://drive.google.com/file/d/1PNumf-68DQh8c4lf_AU7qU-ew6p0t4Ik/view?usp=sharing \n \n \n \n 分組倉儲地址: https://40623144.github.io/stage1-bg23/content/index.html \n \n \n \n 第四週至第九週組員: \n \n 第九週至第十八週組員: \n \n', 'tags': '', 'url': '協同產品設計實習.html'}, {'title': '0226(W1)', 'text': '請依序往分類下去走 \n', 'tags': '', 'url': '0226(W1).html'}, {'title': '第一週文字檔', 'text': '協同產品設計實習第一週 \n 建立課程網址，以及分組，說明課程進行方式 \n 觀看老師上課錄的甲班的影片進行學習 \n 首先一樣先進行github page的創建 \n 至 https://github.com/mdecourse/cmstemplat e \n 點選use this template \n \n \n 建立cd2021的課程倉儲 \n 之後git clone倉儲 \n 倉儲設有submodules 所以必須在後方加入--recurse-submodules才可以clone下來 \n 否則會出問題。 \n git clone完成之後就進入到cmsimde執行python wsgi.py \n 但是遇到了一個問題 抓下來的cmsimde裡面沒有wsgi.py可以執行 \n 當下在課程中無法解決 直到回家才發現使用去年的cad2020內的cmsimde可以使用 \n 所以直接複製過來解決了 \n \n 進入到近端對倉儲進行一些修改就可以轉為靜態並推送了 \n 這裡用一個新的acp指令 \n 一個指令包含了 \n git add . \n git commit\xa0 \n git push \n 即使像我一樣沒有使用SSH連線 也可以成功 且更快速的推送倉儲 \n \n', 'tags': '', 'url': '第一週文字檔.html'}, {'title': '第一週YT影片', 'text': '請點擊右下角cc字幕觀看 影片無聲 \n 影片設為非公開 \n \n', 'tags': '', 'url': '第一週YT影片.html'}, {'title': '第一週文字檔(PDF版)', 'text': 'https://drive.google.com/file/d/1Ikk_2IgJzxo8PT0LoYjWY9vtydiBmeEA/view?usp=sharing \n', 'tags': '', 'url': '第一週文字檔(PDF版).html'}, {'title': '0305(W2)', 'text': '', 'tags': '', 'url': '0305(W2).html'}, {'title': '第二週文字檔', 'text': '進行產品的設計 \n \n 討論要進行的方向 \n \n 學習使用軟體來製作第一週至第四週的作業 \n \n 我們原本的設計是要做小火車頭 \n \n 但是班上有人做過了 \n \n 所以我們選擇製作和火車車輪運動相似的腳踏車 \n \n \n 討論之後我開始繪製腳踏車零件 \n \n 以下由Onshape繪製 \n \n \n \n \n \n 繪製完畢後要進行Onshape的先行模擬 \n \n 模擬完本周進度就結束 \n \n 下周由組員進行V-REP的模擬 \n \n \n \n \n', 'tags': '', 'url': '第二週文字檔.html'}, {'title': '第二週YT影片', 'text': '\n \n', 'tags': '', 'url': '第二週YT影片.html'}, {'title': '第二週文字檔(PDF版)', 'text': 'https://drive.google.com/file/d/1kM5qNkCZ2RfYv3UnQkCHHr3wEihQMXx3/view?usp=sharing \n', 'tags': '', 'url': '第二週文字檔(PDF版).html'}, {'title': '0312(W3)', 'text': '\n', 'tags': '', 'url': '0312(W3).html'}, {'title': '第三週文字檔', 'text': '第三週 \n 我發現在產品的設計上出現了一些問題 \n 第一個是零件在Onshape會自動合併零件的問題 \n 導致零件合併之後在旋轉時有一些零件會跟著中心旋轉軸一起旋轉 \n 這是一個很嚴重的問題 \n 分散的零件可以經由功能"布林運算"進行合併 \n 但是分開的零件卻無法經由同樣的方法來分開 \n 所以最後不得已只好將那個零件重新繪製 \n 浪費了很多問題 \n \n 第二個問題是鍊條的繪製 \n 我發現皮帶輪和鍊條帶動的齒輪很難在Onshape上運行成功 \n 手邊又沒有AutoCAD或相關程式可以繪圖 \n 在使用GOOGLE查詢到學長以前的作品後發現單獨製作鍊條的運轉是非常困難的事情 \n https://40323210.github.io/2016springcd_bG6/static/blog/40323218-qi-mo-bao-gao.html \n 苦思之後決定忍痛捨棄 \n 直接進行V-REP的模擬 \n', 'tags': '', 'url': '第三週文字檔.html'}, {'title': '第三週YT影片', 'text': '\n', 'tags': '', 'url': '第三週YT影片.html'}, {'title': '第三週文字檔(PDF版)', 'text': 'https://drive.google.com/file/d/150hDMApG1sQBeNMiKWdlUzV88TreDYES/view?usp=sharing \n', 'tags': '', 'url': '第三週文字檔(PDF版).html'}, {'title': '0319(W4)', 'text': '', 'tags': '', 'url': '0319(W4).html'}, {'title': '第四週文字檔', 'text': '腳踏車繪製最困難的地方就在於處理鍊條的部分 \n 這部分由於當時的草率行動沒有考慮到製作的高難度 \n 所以在做不出來原本的計畫之後整個作品就顯得簡陋了一些，可以當作是將小型齒輪件隱藏在桿件裡面 \n 不過在腳踏車的設計，包含支架與支架之間的距離要如何拿捏才不會摩擦到 \n 以及要如何將各個不同的零桿件以插銷的方式連接也是一個難點 \n 在花許多的時間重新熟悉繪圖軟體製作出來後，有很大的成就感 \n 希望下一個Stage可以再接再厲。 \n', 'tags': '', 'url': '第四週文字檔.html'}, {'title': '第四週YT影片', 'text': '\n', 'tags': '', 'url': '第四週YT影片.html'}, {'title': '第四週總結(PDF版)', 'text': 'https://drive.google.com/file/d/1KB4vQWVpNY4z9pZ_rkjVYvOQQVByEerZ/view?usp=sharing \n \n', 'tags': '', 'url': '第四週總結(PDF版).html'}, {'title': '0326(W5)', 'text': '', 'tags': '', 'url': '0326(W5).html'}, {'title': '報告影片', 'text': '', 'tags': '', 'url': '報告影片.html'}]};